const INITIAL_USUARIO = {
    page: 'Revisão de REDUX',
    email: '',
    password: '',
}

function reducerUsuario(state = INITIAL_USUARIO, actions) {
    switch (actions) {
        case 'EMAIL':
            return [];

        default:
            break;
    }
    return state;
}

export default reducerUsuario;
